import React, {useState} from 'react'

export default function Textbox(props) {
  return (
    <>
    const [text,setText]= useState("ENTER YOU TEXT");
    <div className="form-floating" rows="10">
        <h1>{props.title}</h1>
    <textarea className="form-control" value={-text} id="floatingTextarea2" ></textarea>
    <div>
        <button className="my-3">Convert To UpperCase</button>
    </div>
    </div>
    </>
  )
}
